import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import axios from 'axios';
import { motion } from 'framer-motion';
import ConfettiBurst from '../components/ConfettiBurst';

const Winner = () => {
  const { id } = useParams();
  const navigate = useNavigate();
  const [raffle, setRaffle] = useState(null);
  const [error, setError] = useState('');
  const [showConfetti, setShowConfetti] = useState(true);
  const isAdmin = !!localStorage.getItem('adminToken');

  useEffect(() => {
    console.log('Winner: id=', id);
    if (!id || id === 'undefined') {
      setError('Invalid raffle ID');
      return;
    }

    axios
      .get(`http://localhost:5000/api/raffles/${id}`)
      .then((res) => {
        setRaffle(res.data);
      })
      .catch((err) => {
        setError(err.response?.data?.error || 'Failed to load raffle');
      });

    // Stop confetti after 5 seconds
    const timer = setTimeout(() => setShowConfetti(false), 5000);
    return () => clearTimeout(timer);
  }, [id]);

  if (error) {
    return (
      <div className="min-h-screen bg-gradient-to-br from-[#4D96FF] to-[#FF6B6B] flex items-center justify-center p-4">
        <div className="text-red-500 text-center">{error}</div>
      </div>
    );
  }

  if (!raffle) {
    return (
      <div className="min-h-screen bg-gradient-to-br from-[#4D96FF] to-[#FF6B6B] flex items-center justify-center p-4">
        <div className="text-white text-center">Loading...</div>
      </div>
    );
  }

  const winner = raffle.participants.find((p) => p.ticketNumber === raffle.winner);

  return (
    <div className="min-h-screen bg-gradient-to-br from-[#4D96FF] to-[#FF6B6B] flex items-center justify-center p-4">
      <motion.div
        initial={{ scale: 0.5, rotate: -10 }}
        animate={{ scale: 1, rotate: 0 }}
        transition={{ duration: 0.8, type: 'spring' }}
        className="bg-white dark:bg-gray-800 rounded-2xl shadow-xl p-8 max-w-md w-full text-center"
      >
        <div className="bg-[#4D96FF] p-4 flex justify-center items-center mb-6 rounded-t-2xl">
          <img
            src="/logo-placeholder.png"
            alt="Raffle Hub Logo"
            className="h-16 w-auto"
            onError={(e) => (e.target.src = '/fallback-logo.png')}
          />
        </div>
        <h1 className="text-4xl font-poppins font-bold text-[#FF6B6B] mb-6">
          üèÜ Winner Announced! üèÜ
        </h1>
        <motion.div
          animate={{ scale: [1, 1.1, 1], rotate: [0, 5, -5, 0] }}
          transition={{ repeat: Infinity, duration: 2 }}
          className="p-4"
        >
          <p className="text-3xl text-[#FFD93D] font-semibold">
            {winner ? `${winner.displayName} wins!` : 'No winner selected.'}
          </p>
          <p className="text-sm text-gray-500 dark:text-gray-400 mt-1">
            Ticket : {winner.ticketNumber}
          </p>
          <p className="text-lg text-gray-600 dark:text-gray-200 mt-2">
            Raffle: {raffle.title}
          </p>
          <p className="text-sm text-gray-500 dark:text-gray-400 mt-1">
            Prize: GHS {raffle.cashPrize}
          </p>
        </motion.div>
        {isAdmin && (
        <motion.button
          whileHover={{ scale: 1.05 }}
          whileTap={{ scale: 0.95 }}
          onClick={() => navigate('/admin')}
          className="mt-6 bg-[#FFD93D] text-black p-3 rounded-lg w-full font-semibold hover:bg-[#FFCA28] transition-colors"
        >
          Back to Dashboard
        </motion.button>)
        }
        <motion.button
          whileHover={{ scale: 1.05 }}
          whileTap={{ scale: 0.95 }}
          onClick={() => navigate('/admin')}
          className="mt-6 bg-[#FFD93D] text-black p-3 rounded-lg w-full font-semibold hover:bg-[#FFCA28] transition-colors"
        >
          Back to Dashboard
        </motion.button>
      </motion.div>
      <ConfettiBurst trigger={showConfetti} />
    </div>
  );
};

export default Winner;
